import { NavLink } from 'react-router-dom';

function Header() {
  const navLinks = [
    ['Главная', '/'],
    ['Бани', '/bany'],
    ['Кухня', '/citchen'],
    ['Массаж', '/massages'],
    ['Контакты', '/contact']
  ];

  return (
    <header className="flex justify-around items-center py-4 bg-white">
      <div>
        <img src="/img/Logo.png" alt="Логотип" className="h-12" />
      </div>
      <nav className="flex justify-between gap-16">
        {navLinks.map(([title, url]) => (
          <NavLink
            key={title}
            to={url}
            className={({ isActive }) =>
              `text-lg font-medium transition-colors duration-200 ${
                isActive ? 'text-[#803613]' : 'text-black hover:text-gray-700'
              }`
            }
          >
            {title}
          </NavLink>
        ))}
      </nav>
    </header>
  );
}

export default Header;
